import React, { Component } from 'react';
import './App.css';

class TodoList extends Component{
    constructor(props){
        super(props);
        this.state = {
            todos: []
        }
    }

    componentDidMount(){
        fetch('/api/todos')
        .then(data => data.json())
        .then(todos => this.setState({todos}));
    }
    render(){
        return(<h1>Todos React App</h1>);
    }
}

export default TodoList;
